import * as React from 'react'
import { Component } from 'react'
import Image from './basicComponents/image'
import { Col } from 'react-bootstrap'
import styles from './../styles/frames.module.css'
export interface FramesProps {
  imageUrls: Array<string>
}

export interface FramesState {}

class Frames extends React.Component<FramesProps, FramesState> {
  render() {
    return (
      <div className={styles.container}>
        <div className={styles.screenshotsContainer}>
          {this.props.imageUrls.map((screenshot) => (
            <Col>
              <div className={styles.screenshotContainer}>
                <Image
                  mode={'fill'}
                  src={require('./../' + screenshot)}
                  width={'100%'}
                  height={'100%'}
                />
              </div>
            </Col>
          ))}
        </div>
      </div>
    )
  }
}

export default Frames
